in_source: |-
  .data
  out_addr: .word   0x84
  num1:     .word   2500
  num2:     .word   1024
  num3:     .word   1111
  num4:     .word   1111
  num5:     .word   4957
  num6:     .word   935
  end:      .word   0
  current:  .word   num1
  next:     .word   num2
  buf:      .word   0

  macro swap
    load    *[next]
    save    [current]
    load    [buf]
    save    [next]
    load    num1
    save    current
    load    num2
    save    next
  endm

    .code
  _start:
    load    *[current]
    save    buf
    load    *[next]
    beqz    print
    sub     [buf]
    bgt     update_pointers
    swap
    jump    _start

  update_pointers:
    load    [next]
    save    current
    load    [next]
    add     1
    save    next
    jump    _start

  print:
    load    num1
    save    current
    load    *[current]
    beqz    stop
    save    [out_addr]
    load    [current]
    add     1
    jump    -6(pc)

  stop:
    halt

in_config: |-
  machine:
    tick_limit: 10000
    memory_mapped_io:
      in_addr: 0x80
      out_addr: 0x84
    output_type: int

